import './App.css';
import React, { useState, useEffect } from 'react';
import axios from "axios";

function App() {
  const [post, setPost] = useState(null);
  useEffect(() => {
    axios
    .get('https://www.koreaexim.go.kr/site/program/financial/exchangeJSON?authkey=3wNf5tfXGjytedr8fF3AUEljbd30YBED&data=AP01')
    .then((res) => {
      setPost(res.data);
      console.log(res.data);
    })
    .catch((err) => {
      console.log(err);
    });
  }, []);

  return (
    <></>
  );
}

export default App;
